TITLE:
  - Test for surface-based coupling between artery network (including
  - scalar transport) and PoroMultiphaseScatra-Framework.
  - 'Test for a larger network segmented from a mouse, the geometry is'
  - publicly available from
  - 'https:'
PROBLEM TYPE:
  PROBLEMTYPE: "Multiphase_Poroelasticity_ScaTra"
POROMULTIPHASESCATRA DYNAMIC:
  RESTARTEVERY: 3
  NUMSTEP: 4
  MAXTIME: 0.024
  TIMESTEP: 0.006
  RESULTSEVERY: 2
  COUPALGO: "twoway_monolithic"
  ARTERY_COUPLING: true
